/**
 * Prediction Demo Component
 * Interactive form for testing the rockfall prediction model
 */

import React, { useState } from 'react';
import { rockfallAPI, validateSensorData, formatRiskLevel } from '../services/api';

const PredictionDemo = () => {
  const [formData, setFormData] = useState({
    slope_angle: 45.0,
    joint_spacing: 1.0,
    joint_orientation: 120.0,
    rock_strength: 50.0,
    weathering_index: 5.0,
    rainfall_24h: 2.0,
    rainfall_7d: 15.0,
    temperature_variation: 15.0,
    freeze_thaw_cycles: 1,
    wind_speed: 5.0,
    vibration_intensity: 1.0,
    blast_distance: 200.0,
    excavation_height: 25.0,
    support_density: 0.5,
    previous_rockfall_30d: 0,
    maintenance_days_since: 10,
  });

  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleInputChange = (field, value) => {
    setFormData(prev => ({
      ...prev,
      [field]: parseFloat(value) || 0
    }));
  };

  const handlePresetLoad = (presetName) => {
    const presets = {
      low_risk: {
        slope_angle: 35.0,
        joint_spacing: 2.0,
        joint_orientation: 180.0,
        rock_strength: 70.0,
        weathering_index: 2.0,
        rainfall_24h: 0.5,
        rainfall_7d: 3.0,
        temperature_variation: 10.0,
        freeze_thaw_cycles: 0,
        wind_speed: 2.0,
        vibration_intensity: 0.5,
        blast_distance: 400.0,
        excavation_height: 15.0,
        support_density: 0.8,
        previous_rockfall_30d: 0,
        maintenance_days_since: 5,
      },
      high_risk: {
        slope_angle: 65.0,
        joint_spacing: 0.3,
        joint_orientation: 90.0,
        rock_strength: 25.0,
        weathering_index: 8.0,
        rainfall_24h: 15.0,
        rainfall_7d: 50.0,
        temperature_variation: 25.0,
        freeze_thaw_cycles: 4,
        wind_speed: 12.0,
        vibration_intensity: 4.0,
        blast_distance: 100.0,
        excavation_height: 50.0,
        support_density: 0.2,
        previous_rockfall_30d: 3,
        maintenance_days_since: 30,
      },
      medium_risk: {
        slope_angle: 50.0,
        joint_spacing: 0.8,
        joint_orientation: 135.0,
        rock_strength: 45.0,
        weathering_index: 5.0,
        rainfall_24h: 5.0,
        rainfall_7d: 20.0,
        temperature_variation: 18.0,
        freeze_thaw_cycles: 2,
        wind_speed: 7.0,
        vibration_intensity: 2.0,
        blast_distance: 250.0,
        excavation_height: 30.0,
        support_density: 0.5,
        previous_rockfall_30d: 1,
        maintenance_days_since: 15,
      }
    };

    if (presets[presetName]) {
      setFormData(presets[presetName]);
      setPrediction(null);
      setError(null);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      // Validate the data
      validateSensorData(formData);
      
      // Make prediction
      const result = await rockfallAPI.predict(formData);
      setPrediction(result);
      
    } catch (err) {
      console.error('Prediction error:', err);
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  const inputFields = [
    { key: 'slope_angle', label: 'Slope Angle (¬∞)', min: 0, max: 90, step: 0.1 },
    { key: 'joint_spacing', label: 'Joint Spacing (m)', min: 0.1, max: 5, step: 0.1 },
    { key: 'joint_orientation', label: 'Joint Orientation (¬∞)', min: 0, max: 360, step: 1 },
    { key: 'rock_strength', label: 'Rock Strength (MPa)', min: 0, max: 200, step: 0.1 },
    { key: 'weathering_index', label: 'Weathering Index (0-10)', min: 0, max: 10, step: 0.1 },
    { key: 'rainfall_24h', label: 'Rainfall 24h (mm)', min: 0, max: 100, step: 0.1 },
    { key: 'rainfall_7d', label: 'Rainfall 7d (mm)', min: 0, max: 200, step: 0.1 },
    { key: 'temperature_variation', label: 'Temperature Variation (¬∞C)', min: 0, max: 50, step: 0.1 },
    { key: 'freeze_thaw_cycles', label: 'Freeze-Thaw Cycles', min: 0, max: 10, step: 1 },
    { key: 'wind_speed', label: 'Wind Speed (m/s)', min: 0, max: 30, step: 0.1 },
    { key: 'vibration_intensity', label: 'Vibration Intensity (mm/s)', min: 0, max: 10, step: 0.1 },
    { key: 'blast_distance', label: 'Blast Distance (m)', min: 50, max: 1000, step: 1 },
    { key: 'excavation_height', label: 'Excavation Height (m)', min: 5, max: 100, step: 0.1 },
    { key: 'support_density', label: 'Support Density (ratio)', min: 0, max: 1, step: 0.01 },
    { key: 'previous_rockfall_30d', label: 'Previous Rockfalls (30d)', min: 0, max: 20, step: 1 },
    { key: 'maintenance_days_since', label: 'Days Since Maintenance', min: 0, max: 100, step: 1 },
  ];

  const riskStyle = prediction ? formatRiskLevel(prediction.risk_category) : null;

  return (
    <div className="space-y-6 slide-in">
      {/* Header */}
      <div>
        <h2 className="text-2xl font-bold text-gray-900">Prediction Demo</h2>
        <p className="text-gray-600">Test the rockfall prediction model with custom sensor data</p>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        {/* Input Form */}
        <div className="card p-6">
          <div className="flex justify-between items-center mb-6">
            <h3 className="text-lg font-semibold">Sensor Input Parameters</h3>
            <div className="flex space-x-2">
              <button
                type="button"
                onClick={() => handlePresetLoad('low_risk')}
                className="btn btn-secondary text-sm"
              >
                Low Risk Preset
              </button>
              <button
                type="button"
                onClick={() => handlePresetLoad('medium_risk')}
                className="btn btn-secondary text-sm"
              >
                Medium Risk Preset
              </button>
              <button
                type="button"
                onClick={() => handlePresetLoad('high_risk')}
                className="btn btn-secondary text-sm"
              >
                High Risk Preset
              </button>
            </div>
          </div>

          <form onSubmit={handleSubmit} className="space-y-4">
            {inputFields.map(({ key, label, min, max, step }) => (
              <div key={key} className="form-group">
                <label htmlFor={key} className="form-label">
                  {label}
                </label>
                <input
                  type="number"
                  id={key}
                  min={min}
                  max={max}
                  step={step}
                  value={formData[key]}
                  onChange={(e) => handleInputChange(key, e.target.value)}
                  className="form-input"
                  required
                />
              </div>
            ))}

            <button
              type="submit"
              disabled={loading}
              className="btn btn-primary w-full"
            >
              {loading ? (
                <div className="flex items-center justify-center">
                  <div className="spinner mr-2" style={{width: '16px', height: '16px'}}></div>
                  Predicting...
                </div>
              ) : (
                'ü§ñ Generate Prediction'
              )}
            </button>
          </form>
        </div>

        {/* Results */}
        <div className="card p-6">
          <h3 className="text-lg font-semibold mb-6">Prediction Results</h3>

          {error && (
            <div className="alert alert-error mb-6">
              <div className="flex items-center">
                <span className="mr-3">‚ö†Ô∏è</span>
                <div>
                  <p className="font-medium">Prediction Failed</p>
                  <p className="text-sm mt-1">{error}</p>
                </div>
              </div>
            </div>
          )}

          {prediction ? (
            <div className="space-y-6">
              {/* Main Risk Assessment */}
              <div 
                className="p-6 rounded-lg border-l-4"
                style={{ 
                  borderLeftColor: riskStyle.color,
                  backgroundColor: riskStyle.bgColor 
                }}
              >
                <div className="flex items-center justify-between">
                  <div>
                    <p className="text-sm font-medium text-gray-600">Risk Category</p>
                    <p 
                      className="text-3xl font-bold mt-2"
                      style={{ color: riskStyle.color }}
                    >
                      {prediction.risk_category}
                    </p>
                    <p className="text-sm text-gray-600 mt-1">
                      {prediction.risk_probability}% probability
                    </p>
                  </div>
                  <div className="text-4xl">
                    {prediction.risk_category === 'Low' && 'üü¢'}
                    {prediction.risk_category === 'Medium' && 'üü°'}
                    {prediction.risk_category === 'High' && 'üü†'}
                    {prediction.risk_category === 'Critical' && 'üî¥'}
                  </div>
                </div>
              </div>

              {/* Confidence Score */}
              <div className="p-4 bg-blue-50 rounded-lg">
                <div className="flex items-center justify-between">
                  <span className="text-sm font-medium text-blue-700">Model Confidence</span>
                  <span className="text-lg font-bold text-blue-600">
                    {prediction.confidence}%
                  </span>
                </div>
              </div>

              {/* Category Breakdown */}
              <div>
                <p className="text-sm font-medium text-gray-700 mb-3">Risk Category Breakdown</p>
                <div className="space-y-2">
                  {Object.entries(prediction.category_probabilities || {}).map(([category, probability]) => {
                    const categoryStyle = formatRiskLevel(category);
                    return (
                      <div key={category} className="flex items-center justify-between">
                        <span className="text-sm text-gray-600">{category} Risk</span>
                        <div className="flex items-center">
                          <div className="w-32 bg-gray-200 rounded-full h-2 mr-3">
                            <div
                              className="h-2 rounded-full"
                              style={{
                                width: `${probability}%`,
                                backgroundColor: categoryStyle.color
                              }}
                            />
                          </div>
                          <span className="text-sm font-medium w-12 text-right">
                            {probability}%
                          </span>
                        </div>
                      </div>
                    );
                  })}
                </div>
              </div>

              {/* Prediction Metadata */}
              <div className="bg-gray-50 p-4 rounded-lg text-sm">
                <p className="font-medium text-gray-700 mb-2">Prediction Details</p>
                <div className="space-y-1 text-gray-600">
                  <p>‚Ä¢ Prediction Time: {new Date(prediction.prediction_time).toLocaleString()}</p>
                  <p>‚Ä¢ API Version: {prediction.api_version}</p>
                  <p>‚Ä¢ Input Parameters: {Object.keys(formData).length} sensor readings</p>
                </div>
              </div>
            </div>
          ) : (
            <div className="text-center py-12 text-gray-500">
              <div className="text-6xl mb-4">ü§ñ</div>
              <p className="text-lg font-medium">No Prediction Generated</p>
              <p className="text-sm mt-2">
                Fill in the sensor parameters and click "Generate Prediction" to see results
              </p>
            </div>
          )}
        </div>
      </div>

      {/* Usage Instructions */}
      <div className="card p-6">
        <h3 className="text-lg font-semibold mb-4">How to Use This Demo</h3>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          <div className="text-center">
            <div className="text-3xl mb-3">üìù</div>
            <h4 className="font-medium mb-2">1. Input Parameters</h4>
            <p className="text-sm text-gray-600">
              Enter sensor readings or use preset scenarios for quick testing
            </p>
          </div>
          <div className="text-center">
            <div className="text-3xl mb-3">üéØ</div>
            <h4 className="font-medium mb-2">2. Generate Prediction</h4>
            <p className="text-sm text-gray-600">
              The AI model analyzes the data and predicts rockfall risk
            </p>
          </div>
          <div className="text-center">
            <div className="text-3xl mb-3">üìä</div>
            <h4 className="font-medium mb-2">3. Review Results</h4>
            <p className="text-sm text-gray-600">
              Get detailed risk assessment with confidence scores and breakdown
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PredictionDemo;
